using IDTechSDK;
using Newtonsoft.Json;
using System;
using System.Collections.Generic;
using System.Diagnostics;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace IPA.CommonInterface.ConfigIDTech.Factory
{
    [Serializable]
    public class TerminalDataFactory
    {
        private byte [] terminalData2C = Common.getByteArray("");
        private byte [] terminalData4C = Common.getByteArray("");
        private byte [] terminalData5C = Common.getByteArray("");
        public byte[] GetFactoryTerminalData(int major)
        {
            switch(major)
            {
                case 2:
                {
                    return terminalData2C;
                }
                case 4:
                {
                    return terminalData4C;
                }
                case 5:
                {
                    return terminalData5C;
                }
            }

            return null;
        }
    }
}
